import React from 'react';
import { Route, Link } from 'react-router-dom';
import Home from './components/Home';
import User from './components/User';
function App() {

  return (
    <div>
      <Route exact path='/' component={Home}/>
      <Route path='/user/:id' component={User}/>
    </div>
  );
}

export default App;
